watchdog
	.create( document.querySelector( '.comment-editor' ), {
		link: {addTargetToExternalLinks: true},
		mediaEmbed: {previewsInData: true, removeProviders: ['spotify', 'twitter', 'facebook', 'instagram', 'flickr', 'googleMaps']},
		wordCount: {
            onUpdate: stats => {
				document.getElementById('comment-word-count-body').textContent = stats.words;
				document.getElementById('comment-character-count-body').textContent = stats.characters;
            }
        },
		toolbar: {
			items: [
				"heading",
				"|", 
				"bold", "underline", "italic", "strikethrough",
				"|", 
				"fontBackgroundColor", "fontColor", "fontFamily", "fontSize", 
				"|", 
				"outdent", "indent", "alignment", 
				"|", 
				"timeStamp", "horizontalLine",
				"-", 
				"link","bulletedList", "numberedList", 
				"|", 
				"highlight", "code", "removeFormat", 
				"|", 
				"imageInsert", "mediaEmbed", 
				"|", 
				"blockQuote", "insertTable", "specialCharacters", 
				"|", 
				"findAndReplace", "selectAll", 
				"|", 
				"redo", "undo"],
			shouldNotGroupWhenFull: true
		},
		language: "en",
		image: {
			toolbar: ["imageTextAlternative", "toggleImageCaption", "imageStyle:inline", "imageStyle:block", "imageStyle:side", "linkImage"]
		},
		table: {
			contentToolbar: ["tableColumn", "tableRow", "mergeTableCells", "tableCellProperties", "tableProperties"]
		},
	} )
	.then( editor => {
		editor = window.watchdog.editor;
		SpecialCharactersEmoji(editor);
	})
	.catch( handleSampleError );

function handleSampleError( error ) {
	const issueUrl = 'https://github.com/ckeditor/ckeditor5/issues';

	const message = [
		'Oops, something went wrong!',
		`Please, report the following error on ${ issueUrl } with the build id "r6g0q5nvvgic-9qp1jqlqjnqg" and the error stack trace:`
	].join( '\n' );

	console.error( message );
	console.error( error );
}
